import React from "react";

const Dashboard = () => {
  return (
    <div className="p-4 h-screen">
      <div className="text-[white] text-[50px] font-bold">
        <h1>Home</h1>
      </div>
      <div className="p-4 grid grid-cols-3 gap-4 h-80">
      <div className="bg-blue-500 p-8 text-white col-span-2">Div 1</div>
      <div className="bg-green-500 p-8 text-white">Div 2</div>
    </div>
        <div className="p-4 grid grid-cols-2 gap-4 h-48">
        <div className="bg-red-500 p-8 text-white">Div 3</div>
        <div className="bg-yellow-500 p-8 text-white">Div 4</div>
        </div>
    </div>
  );
};

export default Dashboard;
